import React, { useState } from 'react';
import './Main.css';

const MenuPage = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isFilterOpen, setIsFilterOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('');

  // Sample categories and items
  const categories = ['Pizza', 'Burgers', 'Sushi', 'Pasta', 'Salads'];
  const items = [
    { name: 'Pepperoni Pizza', category: 'Pizza' },
    { name: 'Cheese Burger', category: 'Burgers' },
    { name: 'California Roll', category: 'Sushi' },
    { name: 'Spaghetti', category: 'Pasta' },
    { name: 'Caesar Salad', category: 'Salads' },
  ];

  // Filter items based on search query and category
  const filteredItems = items.filter((item) => {
    return (
      item.name.toLowerCase().includes(searchQuery.toLowerCase()) &&
      (selectedCategory ? item.category === selectedCategory : true)
    );
  });

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const toggleFilter = () => {
    setIsFilterOpen(!isFilterOpen);
  };

  return (
    <div className='mainfood'>
      <nav className="navbar">
        <div className="menu-icon">
          <button onClick={toggleMenu}>
            <span className="line"></span>
            <span className="line"></span>
            <span className="line"></span>

            {isMenuOpen && (
              <div className="dropdown-menu">
                <ul>
                  <li><a href="/">Home</a></li>
                  <li><a href="/logout">Logout</a></li>
                </ul>
              </div>
            )}
          </button>
        </div>

        <div className="delivery-info">
          <p className='deliver'>Deliver to</p>
          <p className='view'>4102 Pretty View Lane</p>
        </div>

        <div className="nav-image">
          <img src="/assets/foodicon.png" alt="foodicon" />
        </div>
      </nav>

      <div className='mainhead'>
        <h1>What would you like to order</h1>
      </div>

      {/* Search Input */}
      <div className="search-container">
        <input
          type="text"
          placeholder="Search for food or restaurant..."
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        
        {/* Filter Button */}
        <button onClick={toggleFilter} className="filter-button">Filter</button>
      </div>

      {/* Category Filter Dropdown */}
      {isFilterOpen && (
        <div className="category-dropdown">
          <ul>
            {categories.map((category, index) => (
              <li key={index}>
                <button onClick={() => setSelectedCategory(category)}>{category}</button>
              </li>
            ))}
          </ul>
        </div>
      )}

      {/* Display filtered items */}
      <div className="item-list">
        <ul>
          {filteredItems.length === 0 ? (
            <li>No results found</li>
          ) : (
            filteredItems.map((item, index) => (
              <li key={index}>{item.name}</li>
            ))
          )}
        </ul>
      </div>
    </div>
  );
};

export default MenuPage;
